  'Gemeinschaft bietet die M&ouml;glichkeit, Tasten an unterst&uuml;tzten Endgeräten &uuml;ber diese Benutzeroberfl&auml;che zu konfigurieren.' => 'Gemeinschaft offers the configuration of keys for supported devices via this user interface.',
  'Um Tasten f&uuml;r Ihr Endger&auml;t zu konfigurieren, folgen Sie einfach den folgenden Schritten, nachdem Sie links im Men&uuml; auf Tastenbelegung geklickt haben:' => 'To configure keys for your phone, please follow these steps after you clicked on key configuration in the menu on the left:',
  'Schritt 1:' => 'Step 1:',
  'W&auml;hlen Sie Ihr Telefonmodell aus (1) und dr&uuml;cken Sie auf \'Zeigen\' (2)' => 'Choose your phone model (1) and press on \'Show\' (2)',
  'Schritt 2:' => 'Step 2:',
  'Dannach sehen Sie die folgende &Uuml;bersicht (oder &auml;hnlich):' => 'You see the following overview (maybe similar):',
  'Die Bedeutung der einzelnen Spalten:' => 'Meaning of the columns:',
  'Beschreibt die Taste am Telefon, im Beispiel ist F001 die oberste Taste am Display vom Siemens Openstage 60.' => 'Denotes the key on the phone. In the example, F001 is the uppermost key next to the display of a Siemens Openstage 60.',
  'Zeigt an, ob die Taste aktiviert ist oder nicht, Sie k&ouml;nnen die Taste nur definieren, wenn Sie diese vorher mit dem Haken in dieser Box aktivieren. Wenn die Taste vom Administrator vorgegeben ist, wird die Box f&uuml;r den Haken ausgegraut angezeigt. Sie können die Taste nicht bearbeiten.' => 'Indicates wether the key is activated. The key can only be defined if it is activated using the check mark in the box. If the key is predefined by the administrator, the box will be greyed out, and you cannot modify the key then.',
  'Nummer/Daten' => 'Number/data',
  'In dieses Feld werden funktionsspezifische Daten eingetragen, z.B. die Zielnummer bei einer Zielwahl. Mehr dazu erfahren Sie im n&auml;chsten Schritt.' => 'In this field function specific values are entered, e.g. the destination of speed dials. See the next step for more information.',
  'Beschriftung' => 'Label',
  'Hier muss der Text eingegeben werden, wie er am Telefon neben der Taste erscheinen soll.' => 'The text to be shown on the phone next to the key must be entered here.',
  'Gesch&uuml;tzt?' => 'Locked?',
  'Wenn in dieser Spalte ein kleines Schloss angezeigt wird (im Beispiel in den letzten beiden Zeilen), dann ist diese Taste vom Administrator gegen eine Bearbeitung gesch&uuml;tzt. Sie k&ouml;nnen diese Taste nicht konfigurieren.' => 'If a small lock is shown in this column (the last two rows in the example), the key is protected against modifications by the administrator. You cannot configure this key.',
  'Schritt 3:' => 'Step 3:',
  'Aktivieren Sie die Taste durch Anklicken des Hakens in der 2. Spalte (1)' => 'Activate the key by clicking the check mark in the second column (1)',
  'W&auml;hlen Sie aus der Liste (2) die gew&uuml;nschte Tastenfunktion (3) aus:' => 'Choose the desired function (3) from the list (2):',
  'Die Tastenfunktionen sind stark vom benutzten Endger&auml;t abh&auml;ngig. Hier eine Liste f&uuml;r das Openstage 60, welches die Tastenfunktionen der meisten Telefone abdecken sollte:' => 'The available functions depend on the used phone type. This is a list for the Openstage 60, which should cover most phone types:',
  'Liste der einzelnen Tastenfunktionen:' => 'List of available key functions:',
  '-erben-' => '-inherit-',
  'Wenn "-erben-" aktiviert ist, wird die vom Administrator voreingestellte Funktion benutzt.' => 'If "-inherit-" is activated, the function defined by the administrator will be used.',
  'Zielwahl' => 'Selected dialing',
  'Wenn Sie eine Zielwahl auf eine Rufnummer definiert haben, dann k&ouml;nnen Sie die Nummer durch einen Tastendruck anrufen.' => 'If a speed dial to a number is defined, you can dial the number by a single keypress.',
  'Nebenstelle/BLF' => 'Extension/BLF',
  'Aktiviert die Besetztlampenfeldfunktion f&uuml;r eine bestimmte Nebenstelle. Mit der Besetztlampenfeldfunktion k&ouml;nnen Sie den Status der Nebenstelle sehen (Besetzt=Leuchten, Klingeln=Blinken). Desweiteren k&ouml;nnen Sie die Nebenstelle durch einen Druck auf diese Taste anrufen oder eine Ruf&uuml;bernahme durchf&uuml;hren, wenn Sie die Taste dr&uuml;cken w&auml;hrend die Besetztlampe blinkt.' => 'Activates the busylamp field function for a specific extension. With that function you can see the status of the extension (busy=lit, ringing=blink). furthermore you can call this extension by pressing the key, or pick up a call while the lamp is blinking.',
  'Rufton aus' => 'Ringer off',
  'Schaltet den Rufton des Endger&auml;tes an oder aus. Wenn der Rufton aus ist, leuchtet die Lampe der Taste.' => 'Toggles the ringer of the phone. If the ringer is turned off, the lamp will be lit.',
