  'Makeln' => 'Alternate',
  'Mit dieser Funktion kann man zwischen Anrufern hin und her schalten, w&auml;hrend man sich in einer &Uuml;bergabe befindet.' => 'This function allows to switch between active calls while other calls are placed on hold.',
  '&Uuml;bergabe' => 'Attended transfer',
