  'Weiterleiten' => 'Forward',
  'Mit dieser Funktion k&ouml;nnen Sie den Anrufer zu einem bestimmten Ziel weiterleiten.' => 'This function forwards the current call to a specific destination.',
  'Shift' => 'Shift',
  'Mit der Shift-Funktion hat man die M&ouml;glichkeit, Tasten doppelt zu belegen. Die Funktion schaltet zwischen den Ebenen hin und her. Die eigentlichen Tastenfunktionen kann man dann in "Shift-Ebene" festlegen.' => 'The shift function allows to assign multiple functions to the keys. It switches between shift layers. The functions themselves can be assigned with "Shift level".',
  'Kopfh&ouml;rer' => 'Headset',
  'Mit dieser Taste k&ouml;nnen Sie das Gespr&auml;ch zwischen Kopfh&ouml;rer und Lautsprecher umschalten.' => 'This key toggles between headphones and speakerphone.',
  'Nicht st&ouml;ren' => 'Do not disturb',
  'Sie k&ouml;nnen diese Funktion aktivieren, falls Sie z.B. im Kundengespr&auml;ch sind und nicht gest&ouml;rt werden wollen. Das Telefon wird dann nicht klingeln und auch nicht anzeigen, wenn es angerufen wird.' => 'You can activate this feature if e.g. you are in a customer meeting and don\'t want to be disturbed. The phone then will not ring and won\'t show if it is called.',
  'Wenn Sie in einer Rufannahmegruppe sind, k&ouml;nnen Sie ein ankommendes Gespr&auml;ch mit dieser Taste aufnehmen.' => 'If you are in a pickup group, you can answer incoming calls with this key.',
  'Kurzwahl' => 'Repertory dial',
  'Wenn Sie eine Kurzwahl auf eine Rufnummer definiert haben, dann k&ouml;nnen Sie die Nummer durch einen Tastendruck anrufen.' => 'A speed dial allows to call a defined number by a single keypress.',
  'R&uuml;ckfrage' => 'Consultation',
  'Setzt den Anrufer auf "Halten" und ruft die Nummer, die bei Nummer/Daten eingegeben wurde, für eine R&uuml;ckfrage an.' => 'Puts the current call on "Hold" and dials the number that is entered at Number/Data for further consultation.',
  'Fn.-Schalter' => 'Ft. toggle',
  'Mit dem Funktionsschalter kann man bestimmte Telefoniefunktionen aktivieren oder deaktivieren (z.B. die Rufumleitung). W&auml;hlen Sie einfach die gew&uuml;nschte Funktion aus dem Hilfe-Dialog aus. ' => 'With the function switch, specific phone functions can be (de)activated (e.g. call forward). Choose the desired function from the help dialog.',
  'Appl. aufrufen' => 'Start application',
  'Erm&ouml;glicht das Belegen einer Applikation auf eine Taste, damit ist es m&ouml;glich, z.B. das Telefonbuch zu starten. W&auml;hlen Sie einfach die gew&uuml;nschte Applikation aus dem Hilfe-Dialog aus.' => 'Allows mapping of applications to a key, so e.g. the phone book can be opened. Simply choose the desired application from the help dialog.',
  'Schritt 4:' => 'Step 4:',
  'Bei manchen Tastenfunktionen bietet das Programm eine Hilfestellung zum Ausf&uuml;llen der 3.Spalte \'Nummern/Daten\' an, wenn man - wie im Beispiel - \'Nebenstelle/BLF\' ausw&auml;hlt, dann kommt dieser Dialog:' => 'For some function an assistant helps to fill in the third column \'Number/Data\', e.g. if - like in the example, \'Extension/BLF\' is chosen, you\'ll see this dialog:',
  'In diesem Dialog k&ouml;nnen Sie die Nummer (1) die Sie im Besetztlampenfeld anzeigen wollen, eintragen und den Dialog mit dem Haken (2) best&auml;tigen.' => 'You can enter the number (1) which is to be shown on the busylamp field and confirm the dialog with the check mark (2).',
  'Schritt 5:' => 'Step 5:',
  'Dannach sehen Sie, wie der Hilfedialog die Daten in Spalte 3 eingetragen hat. Sie m&uuml;ssen an diesem Text nichts mehr &auml;ndern. Sie k&ouml;nnen zus&auml;tzlich noch eine Beschriftung (1) eingeben, die die Taste am Telefon haben soll:' => 'After that you can see how the help dialog entered the data in column 3. You don\'t have to change the text afterwards. Additionally you can enter a label (1) the key should have on the phone:',
  'Schritt 6:' => 'Step 6:',
  'Sie können Schritt 3-5 f&uuml;r jede Taste, die Sie definieren wollen, wiederholen. Vergessen Sie aber nicht, am Ende auf \'Speichern und Telefon aktualisieren\' (1) zu klicken. Wenn Sie dies getan haben, sollte die &Auml;nderung ca. eine Minute sp&auml;ter auf Ihrem Telefon zu sehen sein.' => 'You may repeat steps 3-5 for every key you like to define. Don\'t forget to click on \'Save and update phone\' (1). When done, the change should be visible ca. one minute later.',
  'Ein-/Ausloggen am Telefon' => 'Login/logout at the phone',
  'Benutzer am Endger&auml;t einloggen. Hierzu wird die Eingabe der PIN-Nummer abgefragt und mit der "#"-Taste best&auml;tigt.' => 'Login user to phone. The PIN has to be entered and confirmed with the "#"-key.',
  'Benutzer am Endger&auml;t ausloggen' => 'Logoff user from phone',
  'Zentrale Kurzwahl' => 'Global speed dial',
  'Kurzwahlnummer' => 'Speed dial number',
  'Wahl der unter der Kurzwahlnummer gespeicherten externen Rufnummer' => 'Dialing of saved speed dial number',
  'Rufumleitung f&uuml;r Anrufe von intern und extern im Fall &quot;immer&quot; auf die Std.-Nummer aktivieren (zur Funktion muss im Men&uuml;punkt "Rufumleitung" eine Std.-Nr. angegeben werden!).' => 'Activate call forwarding for calls from internal and external in case &quot;always&quot; to the default number. (A default number needs to be set in menu "Redirects"!)',
  'Tempor&auml;re Rufumleitung f&uuml;r Anrufe von intern und extern im Fall &quot;immer&quot; auf die angegebene Nummer aktivieren' => 'Activate temporary call forward for calls from internal and external in case &quot;always&quot; to the given number',
  'Tempor&auml;re Rufumleitung f&uuml;r Anrufe von intern und extern im Fall &quot;immer&quot;. Hierzu wird die Eingabe der Nummer abgefragt und mit der "#"-Taste best&auml;tigt.' => 'Program call forwarding for calls from internal and external in case &quot;always&quot;. The destination needs to be entered and confirmed with the "#"-key.',
  'Rufumleitung f&uuml;r Anrufe von intern und extern im Fall &quot;immer&quot; auf den Anrufbeantworter aktivieren' => 'Program call forward for calls from internal and external in case &quot;always&quot; to the voice mail.',
  'Rufumleitung f&uuml;r Anrufe von intern und extern im Fall &quot;immer&quot; auf die Ansage ohne Anrufbeantworter aktivieren' => 'Program call forward for calls from internal and external in case &quot;always&quot; to the voice mail announcement without mailbox.',
  'Rufumleitung f&uuml;r Anrufe von intern und extern im Fall &quot;immer&quot; auf die Zeitsteuerung aktivieren' => 'Program call forward for calls from internal and external in case &quot;always&quot; to the time control',
  'Rufumleitung f&uuml;r Anrufe von intern und extern im Fall &quot;immer&quot; auf den Parallelruf aktivieren' => 'Program call forward for calls from internal and external in case &quot;always&quot; to parallel call',
  'Rufumleitung f&uuml;r Anrufe von intern und extern im Fall &quot;immer&quot; deaktivieren' => 'Deactivate call forwarding for calls from internal and external in case &quot;always&quot;',
  'Rufumleitung f&uuml;r Anrufe von intern im Fall "immer" auf die Std.-Nummer aktivieren (zur Funktion muss im Men&uuml;punkt "Rufumleitung" eine Std.-Nr. angegeben werden!).' => 'Activate call forwarding for calls from internal in case "always" to the default number. (A default number needs to be set in menu "Redirects"!)',
  'Tempor&auml;re Rufumleitung f&uuml;r Anrufe von intern im Fall "immer" auf die angegebene Nummer aktivieren' => 'Activate temporary call forward for calls from internal in case "always" to the given number',
  'Rufumleitung f&uuml;r Anrufe von intern im Fall &quot;immer&quot; auf den Anrufbeantworter aktivieren' => 'Program call forward for calls from internal in case &quot;always&quot; to the voice mail.',
  'Rufumleitung f&uuml;r Anrufe von intern im Fall &quot;immer&quot; auf die Ansage ohne Anrufbeantworter aktivieren' => 'Program call forward for calls from internal in case &quot;always&quot; to the voice mail announcement without mailbox.',
  'Rufumleitung f&uuml;r Anrufe von intern im Fall &quot;immer&quot; auf die Zeitsteuerung aktivieren' => 'Program call forward for calls from internal in case &quot;always&quot; to the time control',
  'Rufumleitung f&uuml;r Anrufe von intern im Fall &quot;immer&quot; auf den Parallelruf aktivieren' => 'Program call forward for calls from internal in case &quot;always&quot; to parallel call',
  'Rufumleitung f&uuml;r Anrufe von intern im Fall &quot;immer&quot; deaktivieren' => 'Deactivate call forwarding for calls from internal in case &quot;always&quot;',
  'Rufumleitung f&uuml;r Anrufe von extern im Fall "immer" auf die Std.-Nummer aktivieren (zur Funktion muss im Men&uuml;punkt "Rufumleitung" eine Std.-Nr. angegeben werden!).' => 'Activate call forwarding for calls from external in case "always" to the default number. (A default number needs to be set in menu "Redirects"!)',
  'Tempor&auml;re Rufumleitung f&uuml;r Anrufe von extern im Fall "immer" auf die angegebene Nummer aktivieren' => 'Activate temporary call forward for calls from external in case "always" to the given number',
  'Rufumleitung f&uuml;r Anrufe von extern im Fall &quot;immer&quot; auf den Anrufbeantworter aktivieren' => 'Program call forward for calls from external in case &quot;always&quot; to the voice mail.',
  'Rufumleitung f&uuml;r Anrufe von extern im Fall &quot;immer&quot; auf die Ansage ohne Anrufbeantworter aktivieren' => 'Program call forward for calls from external in case &quot;always&quot; to the voice mail announcement without mailbox.',
  'Rufumleitung f&uuml;r Anrufe von extern im Fall &quot;immer&quot; auf die Zeitsteuerung aktivieren' => 'Program call forward for calls from external in case &quot;always&quot; to the time control',
  'Rufumleitung f&uuml;r Anrufe von extern im Fall &quot;immer&quot; auf den Parallelruf aktivieren' => 'Program call forward for calls from external in case &quot;always&quot; to parallel call',
  'Rufumleitung f&uuml;r Anrufe von extern im Fall &quot;immer&quot; deaktivieren' => 'Deactivate call forwarding for calls from external in case &quot;always&quot;',
  'Einrichten eines Weckrufes' => 'Set up a wakeup call',
