  'Anrufbeantworter abfragen' => 'Check Voicemail',
  'Eigenen Anrufbeantworter abfragen (an snom-Endger&auml;ten durch Bet&auml;tigen der "Retrive"-Taste m&ouml;glich)' => 'Check own mailbox (on snom phones also possible by using the "Retrieve"-key)',
  'Anderen Anrufbeantworter abfragen (mit PIN)' => 'Check other mailbox (requires PIN)',
  'Abwesenheitsansage aufzeichnen' => 'Record unavailable message',
