  'Privatgespr&auml;che' => 'Private calls',
  'Privatgespr&auml;ch f&uuml;hren' => 'Private call',
  'Einloggen in die Warteschlange mit angegebenen Durchwahl' => 'Login to the queue with given number',
  'Ausloggen aus der Warteschlange mit angegebenen Durchwahl' => 'Logout from the queue with given number',
  'Ausloggen aus allen Warteschlangen' => 'Log out of all queues',
  'Agentennummer' => 'Agent number',
  'Direktes Einloggen eines Agenten. Hierzu wird die Eingabe der PIN-Nummer abgefragt und mit der "#"-Taste best&auml;tigt.' => 'Direct login of an agent. The PIN has to be entered and confirmed with the "#"-key.',
  'Einloggen eines Agenten. Hierzu wird die Eingabe der Agentennummer und der PIN-Nummer abgefragt und mit der "#"-Taste best&auml;tigt.' => 'Direct login of an agent. The agent number and the associated PIN has to be entered and confirmed with the "#"-key.',
  'Agenten ausloggen' => 'Logout agent',
  'Status Pause f&uuml;r Agent aktivieren' => 'Activate pause status for the agent',
  'Status Pause f&uuml;r Agent deaktivieren' => 'Deactivate pause status for the agent',
  'Konferenzen' => 'Conferences',
  'Konf.nr.' => 'Conf.no.',
  'Einen Konferenzraum betreten bzw. er&ouml;ffnen (dazu 88 und eine beliebige 3- oder 4-stellige Nummer w&auml;hlen). Ist der Konferenzraum leer, so kann eine PIN gesetzt werden (ohne PIN Taste # dr&uuml;cken). Ist eine PIN vergeben, so muss diese zum Betreten des Konferenzraumes eingegeben werden.' => 'Enter or create a conference room (dial 88, followed by an arbitrary 3 or 4 digits long number). If the conference room is empty, a PIN can be set up (for no PIN press #). If a PIN is already set up, it has to be entered to join the conference room.',
  'oder' => 'or',
  'Einen freien Konferenzraum finden. Die Nummer der Konferenz wird beim Betreten angesagt. (Die anderen Teilnehmer w&auml;hlen dann <code>88 <i>Konferenznr.</i></code>, s.o.)' => 'Find a free conference room. Will read out the conference number on joining.',
  'Rufnummernunterdr&uuml;ckung (CLIR)' => 'Caller ID suppression (CLIR)',
  'Unterdr&uuml;ckung der eigenen Rufnummer f&uuml;r den n&auml;chsten Anruf (intern und extern)' => 'Caller ID suppression of own caller ID for the next internal or external call',
  'Unterdr&uuml;ckung der eigenen Rufnummer deaktivieren (intern und extern)' => 'Deactivate caller ID suppression (internal and external)',
  'Rufziel' => 'Destination',
  'Unterdr&uuml;ckung der eigenen Rufnummer f&uuml;r einen Anruf zu einem beliebigen Rufziel' => 'Suppression of the own caller ID for a call to an arbitrary destination',
  'Permanente Unterdr&uuml;ckung der eigenen Rufnummer f&uuml;r alle internen Rufziele' => 'Permanent suppression of the own caller ID for all internal destinations',
  'Unterdr&uuml;ckung der eigenen Rufnummer f&uuml;r alle internen Rufziele deaktivieren' => 'Deactivate suppression of the own caller ID for all internal destinations',
  'Permanente Unterdr&uuml;ckung der eigenen Rufnummer f&uuml;r alle externen Rufziele' => 'Permanent suppression of the own caller ID for all external destinations',
  'Unterdr&uuml;ckung der eigenen Rufnummer f&uuml;r alle externen Rufziele deaktivieren' => 'Deactivate suppression of the own caller ID for all external destinations',
  'Angezeigte Rufnummer (CLIP)' => 'Displayed caller ID (CLIP)',
  'Als angezeigte Rufnummer f&uuml;r interne Gespr&auml;che die Standardnummer festlegen' => 'Use the default as displayed caller ID for internal calls',
  'Als angezeigte Rufnummer f&uuml;r interne Gespr&auml;che die angegebene Nummer festlegen' => 'Use the given number as displayed caller ID for internal calls',
  'Als angezeigte Rufnummer f&uuml;r externe Gespr&auml;che die Standardnummer festlegen' => 'Use the default as displayed caller ID for external calls',
  'Als angezeigte Rufnummer f&uuml;r externe Gespr&auml;che die angegebene Nummer festlegen' => 'Use the given number as displayed caller ID for external calls',
  'snom-Telefone weisen abh&auml;ngig vom Ger&auml;te-Typ konfigurierbare Funktionstasten auf, deren Funktionen unten aufgef&uuml;hrt sind. Bitte entnehmen Sie eine ausf&uuml;hrliche Beschreibung der Tasten und Funktionen dem Handbuch zum snom-Telefon.' => 'snom phones have, dependent on the model, configurable function keys. The key functions are described below. Please consult the manual of the snom phone for a detailed explanation of the keys and functions.',
  'Dokumentation snom 320' => 'Documentation for snom 320',
  'Dokumentation snom 360' => 'Documentation for snom 360',
  'Dokumentation snom 370' => 'Documentation for snom 370',
  'Dokumentation snom 820' => 'Documentation for snom 820',
  'Dokumentation snom 821' => 'Documentation for snom 821',
  'Tastenbelegung snom-Telefon' => 'Keymap for snom phone',
  '4 Softkeys unter dem Bildschirm' => '4 softkeys below display',
  'Diese Tasten werden mit kontextabh&auml;ngigen Funktionen belegt. Die Bedeutungen werden ggf. am unteren Rand des Displays angezeigt.' => 'These are context-sensitive softkeys. Their function will we shown at the bottom of the screen as necessary.',
  '<b>Lautst&auml;rke</b> des H&ouml;rers oder Lautsprechers -/+' => '<b>Volume</b> of handset or speaker -/+',
  '<b>Stummschaltung</b> des Mikrofons ein/aus' => '<b>Mute</b> or unmute the microphone',
  '<b>Lauth&ouml;ren</b> ein/aus' => '<b>Speaker</b> on/off',
  '<b>Abbrechen</b><br /> Gespr&auml;ch beenden, Gespr&auml;ch abweisen' => '<b>Cancel</b><br /> Hangup call, deflect call',
  'OK' => 'OK',
  '<b>Best&auml;tigen</b><br /> W&auml;hlen, Gespr&auml;ch annehmen' => '<b>Confirm</b><br /> Dial, answer call',
  '<b>Anrufbeantworter</b> abfragen<br /> Hat der Anrufbeantworter ein Gespr&auml;ch f&uuml;r Sie aufgezeichnet, wird dies durch Blinken der Message-LED signalisiert. Die Anzahl alter und neuer Nachrichten wird zus&auml;tzlich auch auf dem Display angezeigt.' => 'Check <b>Voicemail</b><br /> Once there are new messages on your mailbox the message LED will start blinking. Your display will show the numbers of new and old messages.',
  '<b>Wahlwiederholung</b><br /> Durch Dr&uuml;cken dieser Taste k&ouml;nnen Sie die letzten angerufenen Nummern erneut anrufen und sehen angenommene und verpasste Anrufe. W&auml;hlen Sie zun&auml;chst mit den Pfeiltasten die Nummer aus und dr&uuml;cken danach die OK-Taste.' => '<b>Redial</b><br /> By pressing redial you can redial the numbers of outgoing, answered and missed calls. Use the arrow keys to select a number then press OK.',
  '<b>Telefonbuch</b> (Firma / pers&ouml;nlich)<br /> z.B. 63437 f&uuml;r MEIER dr&uuml;cken (&auml;hnlich &quot;T9&quot;).' => '<b>Phonebook</b> (Company / private)<br /> enter 63437 for MEIER (similar to &quot;T9&quot;).',
  '<b>Vermitteln</b><br /> Es gibt zwei Wege, wie Sie Ihren Gespr&auml;chspartner mit einer anderen Nummer verbinden k&ouml;nnen:<br /> <i>Direktes Verbinden</i>: Wenn Sie w&auml;hrend eines Gespr&auml;chs die Transfer-Taste dr&uuml;cken, wird Ihr Gespr&auml;chsparter auf Halten gesetzt. Geben Sie danach die Nummer an, mit der Sie den Anrufer verbinden m&ouml;chten. Durch Dr&uuml;cken der OK-Taste wird der Teilnehmer dann mit der gew&auml;hlten Nummer verbunden.<br /> <i>Verbinden mit R&uuml;ckfrage</i>: Dr&uuml;cken Sie hierzu w&auml;hrend eines Gespr&auml;chs die Hold-Taste um Ihren Gespr&auml;chspartner zu halten und w&auml;hlen dann die Nummer, mit der Sie ihn verbinden m&ouml;chten. Sie k&ouml;nnen jetzt mit dem zweiten Teilnehmer sprechen. Durch Dr&uuml;cken der Transfer-Taste oder durch Auflegen werden die beiden Teilnehmer verbunden.' => '<b>Transfer</b><br /> There are two ways to transfer the connected party to another number:<br /> <i>Blind transfer</i>: If the Transfer key is pressed during an active call, the connected party will be put on hold. Afterwards, enter the destination number. By pressing the OK key, the other party will be connected to the destination number.<br /> <i>Attended transfer</i>: During an active call, press the Hold key to put the connected party on hold. Then dial the number you wish to transfer the call to. After that you can talk to the other party. By pressing the Transfer key or by hanging up, the both parties will be connected.',
  '<b>Halten</b> (R&uuml;ckfrage)<br /> Wenn Sie diese Taste w&auml;hrend eines Gespr&auml;chs dr&uuml;cken, wird Ihr Gespr&auml;chspartner auf Halten gesetzt. Danach k&ouml;nnen Sie eine weitere Verbindung zu einem anderen Teilnehmer herstellen. Mit den leuchtenden Leitungstasten k&ouml;nnen Sie zwischen beiden Leitungen hin- und herschalten (Makeln).' => '<b>Hold</b> (R)<br /> By pressing this key during an active call, the connected party will be put on hold. After that another connection to another user can be established. Using the lit line keys you can switch between both calls.',
  '<b>Nicht st&ouml;ren</b> ein/aus<br /> Wenn dieser Modus aktiviert ist, werden keine Anrufe zu Ihrem Telefon durchgestellt. Dabei wird auf dem Display "Ruhe/DND" angezeigt. Auf Ihre ggf. eingestellte Rufweiterleitung wirkt dieser Modus, als w&uuml;rden Sie telefonieren, also besetzt.' => '<b>Do Not Disturb</b> on/off<br /> When this mode is activated, no calls will be signalled to the phone. On the display, "DND" will be shown. For eventually enabled call forwards, the mode works as if the phone were busy.',
  '<b>12 Leitungstasten</b><br /> Diese Tasten lassen sich mit Rufnummern programmieren.<br /> Im Men&uuml;punkt &quot;Tastenbelegung&quot; k&ouml;nnen Sie Ihre Einstellung ansehen und ver&auml;ndern.' => '<b>12 Line keys</b><br /> Diese Tasten lassen sich mit Rufnummern programmieren.<br /> Im Men&uuml;punkt &quot;Tastenbelegung&quot; k&ouml;nnen Sie Ihre Einstellung ansehen und ver&auml;ndern.',
