  'Kopfnummer' => 'Main number',
  'Anlagenanschlu&szlig;: Der auf die Ortsvorwahl folgende, f&uuml;r alle Durchwahlen feststehende Teil.<br />Mehrger&auml;teanschlu&szlig;: <tt>99999999</tt>!' => 'Point-to-Point-trunks: The fixed part following the local nummer.<br />Point-to-Multipoint: <tt>99999999</tt>!',
