  'PCRE-Muster f&uuml;r Nummern ohne Vorwahl, z.B. <code>110</code>, <code>112</code>, <code>19222</code>. In Deutschland: <code>^1(?:1[0-9]{1,5}|9222)</code>' => 'PCRE pattern for numbers without prefix, e.g. <code>110</code>, <code>112</code>, <code>19222</code>. In Germany: <code>^1(?:1[0-9]{1,5}|9222)</code>',
